    `},{title:"Topraksz Tarm (Hidroponik): ehirde iftilik Mmkn m?",summary:"Toprak yok, traktr yok, sadece su ve mineral var. Dikey tarm tesisleri ehirleri besleyebilir mi?",date:"18 Nisan 2024",category:"Teknoloji",image:"https://images.unsplash.com/photo-1523348837708-15d4a09cfac2?q=80&w=800&auto=format&fit=crop",content:`
